import React from "react";


const Register = ({ handleRegisterClick}) => {
// Represents sign up page for first time users.

    return (
        <div>
            <h1>Sign up page</h1>
            <p>Press for login page</p>
            <button onClick={handleRegisterClick}>submit</button>
        </div>
    );
}

export default Register;
